static void	sprite_right_arm(t_drown *d)
{
	d->index.i = 0;
	d->index.x = 0;
	d->index.y = 0;
	while (d->index.i <= 2)
	{
		while (d->index.y <= 237)
		{
			while (d->index.x <= 249)
			{
				d->gfx.sprite_right_arm[d->index.i][d->index.y][d->index.x]
					= sprite_to_data(d->index.i, d->index.y, d->index.x);
				d->index.x++;
			}
			d->index.y++;
			d->index.x = 0;
		}
		d->index.i++;
		d->index.y = 0;
	}
	d->index.i = 0;
}

